Perhaps more than any quinquloculine taxon,
Q . seminula
displays a range of slightly different morphologies ( Brady 1884 ; Cushman 1924 ;
Bock et al. 1971
; Hatta & Ujiié 1992b ; a ;
Hayward et al. 1999
). The main variations include the shape of the aperture, the nature of the bifid tooth, how produced the oral end of the test is, how inflated the chambers are and whether the sutures are longitudinally straight, curved or slightly oblique. This variation has led to
Quinqueloculina incisa Vella 1957
and
Quinqueloculina laevigata d’Orbigny 1839
being considered conspecific taxa with
Q . seminula
( Haig 1988 ; Loeblich & Tappan 1994 ;
Hayward et al. 1999
). However,
Q . incisa
does not have a produced oral end and has a large, circular aperture bordered by a peristomal lip with a dental septum that has a trough-like platform ( Vella 1957, pl. 24, figs 118–121 ).
Quinqueloculina laevigata
has more elongate and less inflated chambers than
Q . seminula
, the bifid dentition is more T-shaped than Y-shaped and the oral end is not produced ( d’Orbigny 1839 , pl. 3, figs 31–33). Care must be taken to assigning these three species as their morphological characteristics are so similar and are here considered separate. Further genetic studies of this species may prove the opinions of others ( Haig 1988 ; Loeblich & Tappan 1994 ;
Hayward et al. 1999
) that these three are conspecific and the abovementioned differences merely morphological variation within the single taxon.

Description. See Cushman (1918, p. 290, pl. 96, fig. 4) ;
Hottinger et al . (1993
, p. 56, pl. 47: 8–13; pl. 48: 1–8) and Parker (2009 , p. 259, figs 187a–e).

Description. See Parr (1945 , p. 196, pl. 12, figs 2a–c);
Hayward et al . (1999
, p. 104, pl. 5, figs 11–13) and Parker (2009 , p. 262, figs 191a–j, 192a–l).
